import React from "react";

function UsersTable(props) {
  console.log(props.users);
  return (
    <ul>
      {props.users.map((event) => {
        <li>
          {" "}
          {event.username} - {event.age}
        </li>;
      })}
    </ul>
  );
}

export default UsersTable;
